import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // Ensure you have the corresponding CSS file

const Home = () => {
  return (
    <div className="home">
      <header className="header">
        <nav className="navbar">
          <Link to="/">Home</Link>
          <Link to="/movies">Movies</Link>
          {/* Add other links here */}
        </nav>
        <div className="hero">
          <h1>Welcome to Dark Woods Media</h1>
          <p>Your favorite place to buy movies online.</p>
          <Link to="/movies" className="cta-button">Browse Movies</Link>
        </div>
      </header>
      <section className="featured">
        {/* Carousel or Featured Movies */}
        <h2>Featured Movies</h2>
        {/* Add movie carousel or featured movies here */}
      </section>
      <footer className="footer">
        <p>Contact us at: info@darkwoodsmedia.com</p>
        <nav className="footer-nav">
          <Link to="/about">About Us</Link>
          <Link to="/contact">Contact</Link>
          <Link to="/privacy">Privacy Policy</Link>
        </nav>
      </footer>
    </div>
  );
};

export default Home;
